dna1 = ""
dna2 = ""

#my idea was to just take a O(N) approach, and iterate through each element in the sequence and count whether or not it was the same.

count = 0 #counter for the hamming distance

#counter loop
for i in range(len(dna1)):
    if dna1[i] != dna2[i]:
        count += 1

#prints answer
print(count)